<style>
    #fist {
        animation: fist 2s ease-in-out infinite alternate;
        transform-origin: bottom left;
    }

    #flag {
        animation: flag 2s ease-in-out infinite alternate;
        transform-origin: bottom right;
    }

    #wheel {
        animation: wheel 2s ease-in-out infinite alternate;
        transform-origin: center;
    }


    @keyframes fist {
        from {
            transform: rotate(0deg) scale(1);
        }
        to {
            transform: rotate(-1deg) scale(1.03);
        }
    }

    @keyframes flag {
        from {
            transform: rotate(0deg);
        }
        to {
            transform: rotate(1deg) skewx(2deg);
        }
    }

    @keyframes wheel {
        from {
            rotate: -1deg;
        }
        to {
            rotate: 1deg;
        }
    }
</style>
